import './App.css';
import { useState } from "react";
import Axios from 'axios';

function App() {
  const [name, setName] = useState("");
  const [age, setAge] = useState(0);
  const [country, setCountry] = useState("");
  const [position, setPosition] = useState("");
  const [wage, setWage] = useState(0);

  const addEmployee = () =>{
    console.log(name+age)
    const URL = "http://localhost:3001/new"
    Axios.post(URL, {
      name: name, 
      age: age, 
      country: country,
      position: position,
      wage: wage,
    }).then(() => {
      console.log("Frontend and backend connection successful");
    }).catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      console.log('function excecuted, right or wrong')
    });
  };

  return (
    <div className="App">
      <div className="form">
        <label>Param1: </label>
        <input type="text" onChange={(event => setName(event.target.value))}/>
        <label >Param2(num): </label>
        <input type="number" onChange={(event => setAge(event.target.value))}/>
        <label >Param3: </label>
        <input type="text" onChange={(event => setCountry(event.target.value))}/>
        <label >Param4: </label>
        <input type="text" onChange={(event => setPosition(event.target.value))}/>
        <label >Param5(double): </label>
        <input type="number" onChange={(event => setWage(event.target.value))}/>
        <button onClick={addEmployee}>Add to database</button>
      </div>
    </div>
  );
}

export default App;
